DROP TABLE IF EXISTS STUDENT_BOOK;

CREATE TABLE STUDENT_BOOK (
	SID INT NOT NULL DEFAULT 0,
	BID INT NOT NULL DEFAULT 0,
	ABILITY DOUBLE(20,10) NOT NULL DEFAULT 0,
	DISCRIMINATION DOUBLE(20,10) NOT NULL DEFAULT 0,
	DIFFICULTY DOUBLE(20,10) NOT NULL DEFAULT 0,
	NUMBER_OF_ATTEMPTS INT NOT NULL DEFAULT 0,
	NUMBER_OF_HINTS INT NOT NULL DEFAULT 0,
	NUMBER_OF_INCORRECT_ATTEMPTS INT NOT NULL DEFAULT 0,
	TIMESPENT DOUBLE(20,10) NOT NULL DEFAULT 0,
	ENROLL_YEAR DATE NOT NULL,
	FOREIGN KEY (SID) REFERENCES STUDENT(SID),
	FOREIGN KEY (BID) REFERENCES BOOK(BOOKID)
);

